import "./TrackSearch.css"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';



import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';

const TrackSearch = ({onFilterChange}) => {

  
    const handleInputChange = (e) => {
        const query = e.target.value;
        onFilterChange(query); // Call the onFilterChange function passed from MusicUploadForm
    };

    return(
        <div className="track_">
            <button className="glass-btn btn"><FontAwesomeIcon icon={faMagnifyingGlass} className="glass-icon"/></button>
            <input className="filter-inp " placeholder="Filter..." onChange={handleInputChange} />
        </div>
    )
}

export default TrackSearch;
